In this genre-bending tale from director Gaylene Preston , Meg moves from her parents' place into a flat and buys a stylish old Jaguar in a bid to be more independent. While driving on a country road, she hears screams in the back - but there is no one there. When she picks up a woman in the rain, she recognizes her from a dream. She discovers that this woman was the car's previous owner and she's missing. Now her killer might just be stalking Meg as well. Director Gaylene Preston and producer Robin Laing rented out city cinemas, in order to prove this, their first movie had an audience. Preston was quoted as saying &quot;the queues were so long they went right around the corner and around the block, so we'd race down there and help sell the ice creams to speed things up.&quot;


